a`, `created_at`, `updated_at`) VALUES
(1, '#05A615', '#FFFFFF', '#DF5713', '#F9F5F5', '<h1><br></h1><h1>Money Up Job</h1><p>Money up job Is A Freelancing, Outsourcing And Crowdsourcing Marketplace. We Connect Clients And Freelancers Globally From All Over The World. Through Our Marketplace, Clients Can Hire Freelancers To Do Work In Areas Such As Promoting On Social Networks, Writing, Testing Websites, Data Entry, Downloading, Searching, Installing And Testing Mobile Apps Right Through To Language Learning, Sales And Marketing, Accounting And Legal Services. The Company\'s Mission Is To Make The Process Of Finding Gigs As Simple As Possible, And Provide The Best Service For Everyone Involved. Work Up Job Strives To Help Close The Skills Gap And Build A Better Future For Our Next Generation.<br></p>', 'backend/img/about-us/jzsA76EfwAOumFQ8o4Cs.gif', '<h1 class=\"main_title\" style=\"font-family: \"Lohit Bengali\", Arial, \"Droid Serif\", \"sans-serif\"; line-height: 80px; font-size: 78px; color: rgb(25, 34, 80); text-transform: capitalize;\">Best Microjob & Freelancing Site To Make Money Online</h1>', 'backend/img/about-us/ZePHxClfRWMOsuIWg2RS.png', 'backend/img/about-us/2fRlnZbnoT55gaQZuHVx.png', 'backend/img/about-us/3TSyiXRIpLSZyEG1Glxv.png', 'backend/img/about-us/51y7ttC0th9ezmdU4gcO.png', 'backend/img/about-us/n2344XPFwoeBeSaErKjx.png', 'backend/img/about-us/20ngptVlSC8cd1Rv0jim.png', 'backend/img/about-us/OZy7K6DFWrhlG4dbepbw.avif', 0, 0, 1, 1, 1, 1, 1, '<p><span style=\"color: rgb(33, 37, 41); font-weight: 700;\">Total Job</span><br></p>', 'backend/img/about-us/VpqcLJbmWiQ4vWc4o4pK.png', 1, '<p><span style=\"color: rgb(33, 37, 41); font-weight: 700;\">Total User</span><br></p>', 'backend/img/about-us/3Wz4Rtw7THWPwZy22CKF.png', 1, '<p><span style=\"color: rgb(33, 37, 41); font-weight: 700;\">Task Done</span><br></p>', 1, 'backend/img/about-us/5z8D9nqdUiF3HO5QrnO4.png', '<p><span style=\"color: rgb(33, 37, 41); font-weight: 700;\">Paid</span><br></p>', 'backend/img/about-us/tm7RoqYzWCdtKAD4d2TW.png', 1, 59, 0, 43, 29, 1, 0, 1, 1, 'Reffer Info', '<div><span style=\"font-size: 1rem;\">Deposit Referral Commission 5%&nbsp;</span><span style=\"font-size: 1rem;\">Earning Referral Commission 3%</span><br></div>', '#EF4B09', '#192250', '#0A1347', '#FFFFFF', '#1264E9', '#FFFFFF', '#D5570A', '#FFFFFF', '#02A499', '#FFFFFF', '#FFFFFF', '#160B0B', '#FD5D0D', '#FFFFFF', '#0A6EB8', '#080808', 'Welcome To Moneyup Job', 'Sign in with your account', '<h5 style=\"font-size: 20px; font-family: bold;\">Login Account</h5><p style=\"font-size: 22px; font-family: regular;\">⇀ Moneyup Job, the go-to website for remote job opportunities that can help you earn money quickly and easily. we have something for everyone.<br>Small Gigs. Big Results</p>', 'Create An Account', 'Sign up with credential', '<h5 style=\"font-size: 20px; font-family: bold;\">⤑ Sign Up</h5><p style=\"font-size: 22px; font-family: regular;\">For a better experience, while using our Service, we may require you to provide us with certain personally identifiable information, including but not limited to Email, Full Name, Country, Age. The information that we request will be retained by us and used as described in this privacy policy.With our user-friendly platform and comprehensive job listings, finding the perfect remote gig has never been easier. And the best part? All payouts are made in money, so you can get paid quickly and securely. Start making money today and join the growing community of professionals working from home with Microjob</p>', 'Lost Your Password?', '<h5 style=\"font-family: bold; color: rgb(0, 0, 0); font-size: 20px;\"> How Recover Password?</h5><p style=\"font-size: 22px; font-family: regular;\">For a better experience, while using our Service, we may require you to provide us with certain personally identifiable information, including but not limited to Email, Full Name, Country, Age. The information that we request will be retained by us and used as described in this privacy policy.With our user-friendly platform and comprehensive job listings, finding the perfect remote gig has never been easier. And the best part? All payouts are made in money, so you can get paid quickly and securely. Start making money today and join the growing community of professionals working from home with Microjob</p>', 'Recover Your Password', '#0A1347', '#0A1347', '#F5F5F5', '#0A1347', '#F1F1F1', '#059862', '#F57B26', '#FFFFFF', '#E80808', '#F64E2C', '#FFFFFF', '#E9E3E3', '#24C643', '#1E90FF', '#EF1C1C', '#CECECE', '#EB9E8F', '#F64E2C', '#38A4F8', NULL, '#A3E3F5', NULL, '2023-11-07 04:24:44');
