(5, 'Terms & Condition', 'terms-condition', '<h2 style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\"><p dir=\"ltr\">Dear user, for your information, you should not use micro&nbsp; job up account\'s password and Gmail on any site other than micro-jopup.7-0.pro</p><p dir=\"ltr\">Microjobup.pro authority will not be responsible if you suffer any loss by using any other site. moneyup job will never ask any other site to give money up job\'s info. Thank you!</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">The reason why your account at Workupjob.com has been banned and our policy regarding this ban is mentioned below. Hopefully in time you will read the whole policy. And if you have any questions about this, please comment below, hopefully you will get the answer! Policies-</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">1. You can have multiple accounts at microjobup.pro, but no problem if it is for job posting, but if you work with all the accounts with one device (as a workaholic) all your accounts can be banned and You will not receive your account and your any single balance.</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">2. Using a WiFi line (i.e. from under a router) can be done from a device / account. \"Remember a device.\" - 1-1 As a worker and on the otherhand If you have an account on your device, using its hotspot and wearing under the same IP, your account will be considered as multiple.</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">3. If you submit wrong proofs in proof box, your account will be banned. Here, \"Wrongs proofs\" are regarded as- (irrelevant image, fake informations, threatened, nude images) N.B- \"Submitting proofs without doing the work will also be counted as wrong<span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">r Poofs.\"</span></p><p dir=\"ltr\"><br></p><p dir=\"ltr\">4. Looking at the job, going to the comments section of the job provider\'s YouTube channel \"Coming from moneyup job\" / \"Payment\" / or comment using any offensive language, the account may be banned. 5. If the satisfaction level drops below 75% you will be given a warning with a 24 hour temporary ban. And if it happens again later, it will be a permanent ban.</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">6. In countries where the use of vpn is a legal offense, we never allow vpn in those countries.We hope that by obeying the laws of their respective countries, they will abide by them.</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">Answers to some of your common questions--You can work on one account from two devices, no problem. -You can withdraw \'Withdraw money from multiple accounts in one development number. Hope everybody on this site also had a great day and read on to understand why your account might be banned! Remember moneyupjobteam@gmail.com never bans account for no reason. We are moving forward with your trust and love. Your collaborative attitude inspires us to move forward! You should be aware that there are certain things that Money Up Job will not take responsibility for. Certain functions of the app will require the app to have an active internet connection. The connection can be Wi-Fi, or provided by your mobile network provider, but MoneyUp Job cannot take responsibility for the app not working at full functionality if you don\'t have access&nbsp;to Wi-Fi, and you don\'t have any of your data allowance left.</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">If your account has been banded by those who want to work on our site again, then you must contact our support page by deleting your band account then you will be able to work again. Otherwise your new account will band.</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">If youre using the app outside of an area with Wi-Fi, you should remember that your terms of the agreement with your mobile network provider will still apply. As a result, you may be charged by your mobile provider for the cost of data for the duration of the connection while accessing the app, or other third party charges. In using the app, you\'re accepting responsibility for any such charges, including roaming data charges if you use the app outside of your home territory (i.e. region or country) without turning off data roaming. If you are not the bill payer for the device on which you\'re using the app, please be aware that we assume that you have received permission from the bill payer for using the app.&nbsp;</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">If the job is not updated within 15 days after the job is completed, we will delete the job and We take only 6% commissionfor each job post</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">If you delete your job without 50% satisfaction then your job will not count as valid.</p><p dir=\"ltr\">Any pornographic image or websites related job post won\'t be allowed.</p><p dir=\"ltr\">If you will considered as a multiple account, you will not get your account and any single payment. so, Be careful !</p><p dir=\"ltr\">Your account will be banned if you post a job on a rival site like ours.</p><p dir=\"ltr\">Before making a deposit, you must remember when the deposit balance cannot be brought to the earning balance.</p><p dir=\"ltr\"><br></p><p dir=\"ltr\">Transaction Issue :-</p><p dir=\"ltr\">If you are having trouble in withdraw/deposit method section @microjobup.proteam action, please- contact our Facebook support page within 7 working days. If you don\'t contact us within 7 working days, your withdraw / deposit amount will be counted as non refundable &amp; we will not be able to help you regarding this issue.</p><p dir=\"ltr\">Changes to This Terms and Conditions</p><p dir=\"ltr\">We may update our Terms and Conditions from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Terms and Conditions on this page.</p><p dir=\"ltr\">These terms and conditions are effective as of 2023-08-10</p><p dir=\"ltr\">Contact Us</p><p dir=\"ltr\">If you have any questions or suggestions about our Terms and Conditions, do not hesitate to contact us at microjobup@gmail.com</p></h2>', '2023-01-16 15:40:51', '2024-05-28 15:40:27'),
