(7, 'Refund Policy', 'refund-policy', '<h3 style=\"line-height: 1.5; color: rgb(0, 0, 0); font-size: 1.0625rem;\"><span style=\"font-family: Arial;\">This page deals with return and refund issues. We have decided about return and refund policy.</span></h3><p><span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" left;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" text-decoration-thickness:=\"\" initial;=\"\" text-decoration-style:=\"\" text-decoration-color:=\"\" initial;\"=\"\"><span style=\"font-family: Arial;\"><span style=\"font-weight: bold;\">Our speech is :</span>&nbsp;</span></span><span style=\"font-family: Arial; color: inherit; font-size: 0.9375rem;\">We never return and refund your digital product. When you purchase a product, you have to get it done by the worker. Either you have to get the job done through the worker neither you will not get the product refund or return.</span></p><h4 style=\"line-height: 1.5; color: rgb(0, 0, 0); font-size: 0.9375rem;\"><span style=\"font-family: Arial;\">You\'ll be glad to know that money up job market&nbsp; is one of the best digital marketplaces in the world. It is a freelancing, outsourcing and crowdsourcing marketplace. We connect clients and freelancers globally from all over the World. So let\'s connect with us!</span></h4>', '2023-01-16 15:41:21', '2023-08-09 23:13:18'),
(11, 'Privacy Policy', 'privacy-policy', '<p dir=\"ltr\">Privacy Policy</p><p dir=\"ltr\">Last updated: August 09, 2023</p><p dir=\"ltr\">This Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You.</p><p dir=\"ltr\">We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy. This Privacy Policy has been created with the help of the&nbsp;Free Privacy Policy Generator.</p><p dir=\"ltr\">Interpretation and Definitions</p><p dir=\"ltr\">Interpretation</p><p dir=\"ltr\">The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p><p dir=\"ltr\">Definitions</p><p dir=\"ltr\">For the purposes of this Privacy Policy:</p><p dir=\"ltr\">Account&nbsp;means a unique account created for You to access our Service or parts of our Service.</p><p dir=\"ltr\">Affiliate&nbsp;means an entity that controls, is controlled by or is under common control with a party, where \"control\" means ownership of 50% or more of the shares, equity interest or other securities entitled to vote for election of directors or other managing authority.</p><p dir=\"ltr\">Company&nbsp;(referred to as either \"the Company\", \"We\", \"Us\" or \"Our\" in this Agreement) refers to money up job, Bangladesh .</p><p dir=\"ltr\">Cookies&nbsp;are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.</p><p dir=\"ltr\">Country&nbsp;refers to: Bangladesh</p><p dir=\"ltr\">Device&nbsp;means any device that can access the Service such as a computer, a cellphone or a digital tablet.</p><p dir=\"ltr\">Personal Data&nbsp;is any information that relates to an identified or identifiable individual.</p><p dir=\"ltr\">Service&nbsp;refers to the Website.</p><p dir=\"ltr\">Service Provider&nbsp;means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.</p><p dir=\"ltr\">Third-party Social Media Service&nbsp;refers to any website or any social network website through which a User can log in or create an account to use the Service.</p><p dir=\"ltr\">Usage Data&nbsp;refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</p><p dir=\"ltr\">Website&nbsp;refers to money up job, accessible from&nbsp;<a href=\"https://moneyupjob.com\">https://moneyupjob.com</a></p><p dir=\"ltr\">You&nbsp;means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</p><p dir=\"ltr\">Collecting and Using Your Personal Data</p><p dir=\"ltr\">Types of Data Collected</p><p dir=\"ltr\">Personal Data</p><p dir=\"ltr\">While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:</p><p dir=\"ltr\">Email address moneyupjobteam@gmail&nbsp;</p><p dir=\"ltr\">First Website last name money up job&nbsp;</p><p dir=\"ltr\">Phone number 01853106586</p><p dir=\"ltr\">Address, coxbazar State cortbazar, Province klasipada, ZIP 4700/Postal code, City coxabzar</p><p dir=\"ltr\"><span style=\"font-size: 1rem;\">Usage&nbsp;</span>Data</p><p dir=\"ltr\"><span style=\"font-size: 1rem;\">Usage</span><span style=\"font-size: 1rem;\">Usage Data is collected automatically when using the Service.</span></p><p dir=\"ltr\">Usage Data may include information such as Your Device\'s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p><p dir=\"ltr\">We may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.</p><p dir=\"ltr\">Information from Third-Party Social Media Services</p><p dir=\"ltr\">The Company allows You to create an account and log in to use the Service through the following Third-party Social Media Services:</p><p dir=\"ltr\">Google</p><p dir=\"ltr\">Facebook</p><p dir=\"ltr\">Instagram</p><p dir=\"ltr\">Twitter</p><p dir=\"ltr\"> LinkedIn</p><p dir=\"ltr\">If You decide to register through or otherwise grant us access to a Third-Party Social Media Service, We may collect Personal data that is already associated with Your Third-Party Social Media Service\'s account, such as Your name, Your email address, Your activities or Your contact list associated with that account.</p><p dir=\"ltr\">You may also have the option of sharing additional information with the Company through Your Third-Party Social Media Service\'s account. If You choose to provide such information and Personal Data, during registration or otherwise, You are giving the Company permission to use, share, and store it in a manner consistent with this Privacy Policy.</p><p dir=\"ltr\">Tracking Technologies and Cookies</p><p dir=\"ltr\">We use Cookies and similar tracking technologies to track the activity on Our Service and store certain information. Tracking technologies used are beacons, tags, and scripts to collect and track information and to improve and analyze Our Service. The technologies We use may include:</p><p dir=\"ltr\">Cookies or Browser Cookies.&nbsp;A cookie is a small file placed on Your Device. You can instruct Your browser to refuse all Cookies or to indicate when a Cookie is being sent. However, if You do not accept Cookies, You may not be able to use some parts of our Service. Unless you have adjusted Your browser setting so that it will refuse Cookies, our Service may use Cookies.</p><p dir=\"ltr\">Web Beacons.&nbsp;Certain sections of our Service and our emails may contain small electronic files known as web beacons (also referred to as clear gifs, pixel tags, and single-pixel gifs) that permit the Company, for example, to count users who have visited those pages or opened an email and for other related website statistics (for example, recording the popularity of a certain section and verifying system and server integrity).</p><p dir=\"ltr\">Cookies can be \"Persistent\" or \"Session\" Cookies. Persistent Cookies remain on Your personal computer or mobile device when You go offline, while Session Cookies are deleted as soon as You close Your web browser. Learn more about cookies on the&nbsp;Free Privacy Policy website&nbsp;article.</p><p dir=\"ltr\">We use both Session and Persistent Cookies for the purposes set out below:</p><p dir=\"ltr\">Necessary / Essential Cookies</p><p dir=\"ltr\">Type: Session Cookies</p><p dir=\"ltr\">Administered by: Us</p><p dir=\"ltr\">Purpose: These Cookies are essential to provide You with services available through the Website and to enable You to use some of its features. They help to authenticate users and prevent fraudulent use of user accounts. Without these Cookies, the services that You have asked for cannot be provided, and We only use these Cookies to provide You with those services.</p><p dir=\"ltr\">Cookies Policy / Notice Acceptance Cookies</p><p dir=\"ltr\">Type: Persistent Cookies</p><p dir=\"ltr\">Administered by: Us</p><p dir=\"ltr\">Purpose: These Cookies identify if users have accepted the use of cookies on the Website.</p><p dir=\"ltr\">Functionality Cookies</p><p dir=\"ltr\">Type: Persistent Cookies</p><p dir=\"ltr\">Administered by: Us</p><p dir=\"ltr\">Purpose: These Cookies allow us to remember choices You make when You use the Website, such as remembering your login details or language preference. The purpose of these Cookies is to provide You with a more personal experience and to avoid You having to re-enter your preferences every time You use the Website.</p><p dir=\"ltr\">For more information about the cookies we use and your choices regarding cookies, please visit our Cookies Policy or the Cookies section of our Privacy Policy.</p><p dir=\"ltr\">Use of Your Personal Data</p><p dir=\"ltr\">The Company may use Personal Data for the following purposes:</p><p dir=\"ltr\">To provide and maintain our Service, including to monitor the usage of our Service.</p><p dir=\"ltr\">To manage Your Account:&nbsp;to manage Your registration as a user of the Service. The Personal Data You provide can give You access to different functionalities of the Service that are available to You as a registered user.</p><p dir=\"ltr\">For the performance of a contract:&nbsp;the development, compliance and undertaking of the purchase contract for the products, items or services You have purchased or of any other contract with Us through the Service.</p><p dir=\"ltr\">To contact You:&nbsp;To contact You by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application\'s push notifications regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.</p><div align=\"left\"><p dir=\"ltr\"><b>To provide You</b>&nbsp;with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless You have opted not to receive such information.<br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><p dir=\"ltr\"><b>To manage Your requests:</b>&nbsp;To attend and manage Your requests to Us.<br>\r\n</p><p dir=\"ltr\"><br>\r\n</p><p dir=\"ltr\"><b>For business transfers:</b>&nbsp;We may use Your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of Our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by Us about our Service users is among the assets transferred.<br>\r\n</p><p dir=\"ltr\"><br>\r\n</p><p dir=\"ltr\"><b>For other purposes</b>: We may use Your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Service, products, services, marketing and your experience.<br>\r\n</p><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\">We may share Your personal information in the following situations:</p></div><div align=\"left\"><p dir=\"ltr\"><b>With Service Providers:</b>&nbsp;We may share Your personal information with Service Providers to monitor and analyze the use of our Service, to contact You.</p></div><p dir=\"ltr\"><b>For business transfers:</b>&nbsp;We may share or transfer Your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of Our business to another company.</p><p dir=\"ltr\"><b>With Affiliates:</b>&nbsp;We may share Your information with Our affiliates, in which case we will require those affiliates to honor this Privacy Policy. Affiliates include Our parent company and any other subsidiaries, joint venture partners or other companies that We control or that are under common control with Us.</p><p dir=\"ltr\"><b>With business partners:</b>&nbsp;We may share Your information with Our business partners to offer You certain products, services or promotions.</p><p dir=\"ltr\"><b>With other users:</b>&nbsp;when You share personal information or otherwise interact in the public areas with other users, such information may be viewed by all users and may be publicly distributed outside. If You interact with other users or register through a Third-Party Social Media Service, Your contacts on the Third-Party Social Media Service may see Your name, profile, pictures and description of Your activity. Similarly, other users will be able to view descriptions of Your activity, communicate with You and view Your profile.<br>\r\n</p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><div align=\"left\"><p dir=\"ltr\"><span style=\"font-size:1.30em;\"><b>Law enforcement</b></span><br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\">Under certain circumstances, the Company may be required to disclose Your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).<br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\"><span style=\"font-size:1.30em;\"><b>Other legal requirements</b></span><br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\">The Company may disclose Your Personal Data in the good faith belief that such action is necessary to:<br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\">Comply with a legal obligation<br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><p dir=\"ltr\">Protect and defend the rights or property of the Company<br>\r\n</p><p dir=\"ltr\"><br>\r\n</p><p dir=\"ltr\">Prevent or investigate possible wrongdoing in connection with the Service<br>\r\n</p><p dir=\"ltr\"><br>\r\n</p><p dir=\"ltr\">Protect the personal safety of Users of the Service or the public<br>\r\n</p><p dir=\"ltr\"><br>\r\n</p><p dir=\"ltr\">Protect against legal liability<br>\r\n</p><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\"><span style=\"font-size:1.40em;\"><b>Security of Your Personal Data</b></span><br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\">The security of Your Personal Data is important to Us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While We strive to use commercially acceptable means to protect Your Personal Data, We cannot guarantee its absolute security.<br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\"><span style=\"font-size:1.50em;\"><b>Children\'s Privacy</b></span><br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\">Our Service does not address anyone under the age of 13. We do not knowingly collect personally identifiable information from anyone under the age of 13. If You are a parent or guardian and You are aware that Your child has provided Us with Personal Data, please contact Us. If We become aware that We have collected Personal Data from anyone under the age of 13 without verification of parental consent, We take steps to remove that information from Our servers.<br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\">If We need to rely on consent as a legal basis for processing Your information and Your country requires consent from a parent, We may require Your parent\'s consent before We collect and use that information.<br>\r\n</p>\r\n</div><p dir=\"ltr\"><br>\r\n</p><div align=\"left\"><p dir=\"ltr\"><span style=\"font-size:1.50em;\"><b>Links to Other Websites</b></span></p></div><div align=\"left\"><p dir=\"ltr\">Our Service may contain links to other websites that are not operated by Us. If You click on a third party link, You will be directed to that third party\'s site. We strongly advise You to review the Privacy Policy of every site You visit.</p></div><div align=\"left\"><p dir=\"ltr\">We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.<br>\r\n</p>\r\n</div><p dir=\"ltr\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><h1 style=\"color: rgb(0, 0, 0); font-family: \" times=\"\" new=\"\" roman\";\"=\"\">Changes to this Privacy Policy</h1><p style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">We may update Our Privacy Policy from time to time. We will notify You of any changes by posting the new Privacy Policy on this page.</p><p style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">We will let You know via email and/or a prominent notice on Our Service, prior to the change becoming effective and update the \"Last updated\" date at the top of this Privacy Policy.</p><p style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p><h1 style=\"color: rgb(0, 0, 0); font-family: \" times=\"\" new=\"\" roman\";\"=\"\">Contact Us</h1><p style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">If you have any questions about this Privacy Policy, You can contact us:</p><p dir=\"ltr\">\r\n</p><ul style=\"font-family: \" times=\"\" new=\"\" roman\";=\"\" font-size:=\"\" medium;\"=\"\"><li><p>By email:&nbsp;<a href=\"https://www.highcpmgate.com/zkm51qcu?key=79d6350c94354f0c1abbc6a7ddd7b9f0\" class=\"__cf_email__\" data-cfemail=\"6b0604050e121e1b0104091f0e0a062b0c060a020745080405\" target=\"_blank\">[email&nbsp;protected]</a></p></li><li><p>By visiting this page on our website: micro-jobup.7-0.pro</p></li><li><p>By phone number: 0180000000</p></li><li><p>By address : mymensingh</p></li></ul>', '2023-08-09 22:05:29', '2024-05-28 15:38:05');
